%[text] ## Predictor importance
clear
load("RF_modeli/RF_2019.mat");
load('RF_modeli/RF_2021.mat');
load('RF_modeli/RF_2021_red.mat');
load("data/tbl_2019.mat");
load("data/tbl_2021.mat");

%%
modeli = {mdl_2019, mdl_2021, mdl_2021_red};
godine = ["2019", "2021", "2021 redukovan"];
for i = 1:length(modeli) %[output:group:496cc87b]
    model = modeli{i};
    imp = predictorImportance(model);
    figure %[output:9785de61] %[output:20ee2764] %[output:90c053ea]
    bar(imp); %[output:9785de61] %[output:20ee2764] %[output:90c053ea]
    xticklabels(model.PredictorNames)
    xtickangle(45);
    title('Znacaj prediktora za Random Forest Model ' + godine(i));
end %[output:group:496cc87b]

%%
%[text] ## ICE plots
for i = 1:length(modeli) %[output:group:08d67223]
    model = modeli{i};
    imp = predictorImportance(model);
    [~, idx] = maxk(imp, 3);
    topPredictors = model.PredictorNames(idx);
    
    figure; %[output:843bc0bc] %[output:34335378] %[output:2c968118]
   
    for j = 1:length(topPredictors)
        subplot(1,3, j); %[output:843bc0bc] %[output:34335378] %[output:2c968118]
        plotPartialDependence(model, topPredictors(j), Conditional="centered");
        title("Uticaj " + topPredictors(j) + " na m/r")
        xlabel(topPredictors(j));
        ylabel('m/r');
    end
    sgtitle("ICE + PDP — RF model " + godine(i));
end %[output:group:08d67223]


%%
m_2021_red = normalize(tbl_2021{:, 2:end-1});
[PD, X1, X2] = partialDependence(mdl_2021_red, {'starost_PC1', 'ON'}, m_2021_red);

%%
%[text] ## Surf

figure %[output:529babd5]
surf(X1, X2,PD) %[output:529babd5]
xlabel('starost\_PC1') %[output:529babd5]
ylabel('ON') %[output:529babd5]
zlabel('Predviđeni mr') %[output:529babd5]
title('Uticaj starost\_PC1 i ON na mr (RF 2021 redukovan)') %[output:529babd5]
colormap turbo         %[output:529babd5]
colorbar               %[output:529babd5]
shading interp       %[output:529babd5]
grid on; box on; %[output:529babd5]

%%
%[text] ## Heatmap

figure %[output:35105d21]
imagesc(X1, X2, PD) %[output:35105d21]
xlabel('starost\_PC1') %[output:35105d21]
ylabel('ON') %[output:35105d21]
colormap(flipud(redbluecmap)) %[output:35105d21]
colorbar %[output:35105d21]

%%
GHSI_2021_PC1 = normalize(tbl_2021{:,1});
p75 = prctile(GHSI_2021_PC1, 75);
idxTop25 = find(GHSI_2021_PC1 >= p75);
hold on %[output:72b799b3]
scatter(X1(idxTop25), X2(idxTop25), 'filled', 'b') %[output:72b799b3]
legend("Top 25% GHSI countries") %[output:72b799b3]


